INSERT INTO `jos_content` (`id`, `title`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(1, 'Welcome to the Mahsie OSS Demo Site', 'Welcome to the Mahsie OSS Demo Site', '<p style="font-family: Arial,Helvetica,sans-serif; font-size: 12px">Mahsie Open Source Solutions Inc. is dedicated to bringing open source to those who need it most:  charities, non-profit organizations and small businesses.  Our initial line of open source solutions is designed for sectors and organizations for whom essential business tools were previously unavailable or unaffordable.  </p><p style="font-family: Arial,Helvetica,sans-serif; font-size: 12px">This site has been built to demonstrate the various open source applications Mahsie is currently implementing for our clients.  To find out more about Mahsie OSS Inc., please visit our <a href="http://www.mahsie.com">main web site</a> .  </p><p style="font-family: Arial,Helvetica,sans-serif; font-size: 12px">&nbsp;</p><p style="font-family: Arial,Helvetica,sans-serif; font-size: 12px">This site effectively demonstrates our key applications:</p><table border="0" cellspacing="3" cellpadding="2" width="90%"><tbody><tr><td width="50%"> <strong>Content Management System</strong> - This demonstration site is built using the Joomla Content Management System. It acts as a ''wrapper'' and common interface for our other applications, which are accessible from the menu above <strong>(Demo CRM is integrated with demo ERP).</strong><br /></td><td width="50%"><strong>Customer Relationship Management</strong> - This Customer Relationship Mangement application is built using the most established, mature and supported open source CRM suites, VTiger CRM. It is also integrated with the Mahsie ERP system and is the base for the fundraising, membership management and school registration systems. <br /></td></tr><tr><td> <strong>Enterprise Resource Planning </strong>- Mahsie took the very best open source Enterprise Resource Planning (ERP) system - webERP - and merged it with other applications to create an end-to-end solution for any business. Together with our customized VTiger CRM, our modified webERP system tracks everything from leads, quotes, orders, sales, inventory, shipping, warehousing, manufacturing, production and finance in one suite. It comes with various preformatted reports and several reporting tools and functions. Built around an industrial grade relational database, this is the perfect solution for any small to medium sized organization.</td><td> <strong>School Registration </strong>- the Mahsie School Registration System is designed for any school or organization that has ongoing classes to schedule. Track students, courses, teachers, transcripts and payments with one system - and more.  Built around a modified VTiger CRM installation<br /></td></tr><tr><td> <strong>Membership Registration System</strong> - Our Membership Registration System is perfect for any membership-based group. Easily track membership payments, individuals and families, multiple addresses, contact details, requests, forms and more.  Another modified VTiger CRM product.<br /></td><td> <strong>Fundraising Management System<em>(coming soon)</em></strong> - Our Fundraising Management System takes the best from VTiger CRM 5 and other fundraising systems and combines them into onto application. It tracks multiple, complex, many-to-many relationships between people and organizations, and includes features to manage campaigns and donations - both in-kind and in cash.</td></tr></tbody></table>', '', 1, 1, 0, 1, '2007-02-11 12:25:35', 62, '', '2007-02-20 00:59:51', 62, 0, '0000-00-00 00:00:00', '2007-02-08 01:00:00', '2009-02-27 05:00:00', '', '', 'pageclass_sfx=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nlanguage=en-GB\nkeyref=', 8, 0, 1, '', '', 0, 0, 'robots=\nauthor=');
